import React from "react";
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  Image,
} from 'react-native';
import ScreenTemplate from "./screenTemplate";
import styles from "./styles/General";
import expbox from "./styles/General";


export default function Explore() {
  return(
    <ScreenTemplate contentContainerStyle={styles.scrollView}>
      <ScrollView>
        <Text style={{fontSize:50}}>Explore</Text>
        <View style={expbox.exploreBox}><Text>Books & More</Text></View>
        <View style={expbox.exploreBox}><Text>Articles and Databases</Text></View>
        <View style={expbox.exploreBox}><Text>Course Reserve</Text></View>
      </ScrollView>
    </ScreenTemplate>
  )
}
